import React from "react";


class SignUp extends React.Component {
    constructor(){
        super()

        this.state={
        email:"Email",
        password:"",
        passworbis:"",
        name:"",
        lastname:"",
    }

        this.updateEmailField = this.updateEmailField.bind(this);
}   
    updateEmailField = (e) => {
        this.setState({[e.target.name]: e.target.value})
    }

    render () {
        return(
            <div>
            <h1>{this.state.email} </h1>
            <input type="text" name="name" value={this.state.name} onChange={this.updateEmailField}/>
            <input type="text" name="lastname" value={this.state.lastname} onChange={this.updateEmailField}/>
            <input type="email" name="email" value={this.state.email} onChange={this.updateEmailField}/>
            <input type="password" name="password" value={this.state.email} onChange={this.updateEmailField}/>
            <input type="password" name="passwordbis" value={this.state.email} onChange={this.updateEmailField}/>
            <input type="submit" value="Soumettre" />
            </div>
        ) 
    }
}
export default SignUp;
